DROP TABLE IF EXISTS `prefix_monit_education`;
CREATE TABLE  `prefix_monit_education` (
  `id` int(10) NOT NULL auto_increment,
  `uniqueconstcode` int(10) unsigned NOT NULL default '0',
  `rayonid` int(10) NOT NULL default '0',
  `yearid` int(10) unsigned NOT NULL default '1',
  `isclosing` tinyint(4) NOT NULL default '0',
  `dateclosing` int(10) default NULL,
  `number` int(10) NOT NULL default '0',
  `name` varchar(255) NOT NULL default '',
  `headid` int(10) default '0',
  `fio` varchar(100) default NULL,
  `appointment` varchar(255) NOT NULL default '',
  `isdirectormanager` tinyint(1) default '0',
  `typeinstitution` tinyint(4) NOT NULL default '0',
  `stateinstitution` tinyint(4) NOT NULL default '0',
  `numsession` tinyint(4) NOT NULL default '1',
  `numlicense` varchar(20) NOT NULL default '',
  `regnumlicense` varchar(20) NOT NULL default '',
  `startdatelicense` int(10) default NULL,
  `enddatelicense` int(10) default NULL,
  `numlicensextra` varchar(20) NOT NULL default '',
  `regnumlicensextra` varchar(20) NOT NULL default '',
  `startdatelicensextra` int(10) default NULL,
  `enddatelicenseextra` int(10) default NULL,
  `numcertificate` varchar(20) NOT NULL default '',
  `regnumcertificate` varchar(20) NOT NULL default '',
  `startdatecertificate` int(10) default NULL,
  `enddatecertificate` int(10) default NULL,
  `inn` varchar(20) NOT NULL default '',
  `kpp` varchar(20) NOT NULL default '',
  `okpo` varchar(20) NOT NULL default '',
  `okato` varchar(20) NOT NULL default '',
  `okogu` varchar(20) NOT NULL default '',
  `okfs` varchar(20) NOT NULL default '',
  `okved` varchar(20) NOT NULL default '',
  `type_ege` tinyint(4) NOT NULL default '0',
  `state_ege` tinyint(4) NOT NULL default '0',
  `typesettlement` tinyint(4) NOT NULL default '0',
  `iscountryside` tinyint(1) NOT NULL default '0',
  `fax` varchar(20) NOT NULL default '',
  `isjurequalreal` tinyint(1) NOT NULL default '0',
  `juridicaladdress` varchar(255) NOT NULL default '',
  `phones` varchar(100) default NULL,
  `realaddress` varchar(255) default NULL,
  `www` varchar(255) default NULL,
  `email` varchar(255) default NULL,
  `timemodified` int(10) default NULL,
  `type_ou` tinyint(3) default '0',
  `code` int(10) unsigned NOT NULL default '999999',
  `isukg` tinyint(1) default '0',
  `codeppe` varchar(3) NOT NULL default '999',
  `typeeducation` INTEGER UNSIGNED NOT NULL default 0,
  `sitingcapacity` INTEGER UNSIGNED NOT NULL default 0,
  `childrencapacity` INTEGER UNSIGNED NOT NULL default 0,
  PRIMARY KEY  (`id`),
  KEY `rayonid` (`rayonid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;







DROP TABLE IF EXISTS `prefix_monit_education_type`;
CREATE TABLE `prefix_monit_education_type` (
  `id` int(10) unsigned NOT NULL auto_increment,
  `name` text NOT NULL,
  `visible` tinyint(1) NOT NULL default 0,  
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

